import {Routes, Route} from 'react-router-dom'
import AddBook from './Component/AddBook';

function App() {
  return (
      <div>
        <Routes>
          <Route path='/' element={ <AddBook/> } />
        </Routes>
      </div>
  );
}

export default App;
